import React, {Component} from 'react'
import { NavLink } from 'react-router-dom';
import './register_style.css'

class RegisterDoctor extends React.Component {
    constructor() {
        super();
        this.state = {
            email: '',
            password: '',
            firstname: '',
            surname: '',
            birthdate: '',
            specialization: '',
            education: '',
            doccode: ''
        }
    }

    submit_register = (event) =>{
        event.preventDefault();
        console.log(this.state.email + " " + this.state.password);
        this.setState({email : ''});
        this.setState({password: ''});
        this.setState({birthdate: ''});
        this.setState({surname: ''});
        this.setState({firstname: ''});


    }

    ev_email = (event) => {
        this.setState({email : event.target.value});
    }
    ev_password = (event) => {
        this.setState({password : event.target.value});
    }
    ev_firstname = (event) => {
        this.setState({firstname : event.target.value});
    }
    ev_surname = (event) => {
        this.setState({surname : event.target.value});
    }
    ev_date = (event) => {

    }
    ev_education = (event) => {
        this.setState({surname : event.target.value});
    }
    ev_doccode = (event) => {
        this.setState({surname : event.target.value});
    }
    ev_specialization = (event) => {
        this.setState({surname : event.target.value});
    }

    render() {
    return (
        <div className= "register">
            {/* <NavLink to = 'registerdoctor'>Doctor</NavLink> */}
            <form onSubmit={this.submit_register}>

                <label >Email</label>
                <input type = "text" value = {this.state.email} onChange = {this.ev_email}/>

                <label >Password</label>
                <input type = "password" value = {this.state.password} onChange = {this.ev_password}/>

                <label >First Name</label>

                <input type = "text" value = {this.state.firstname} onChange = {this.ev_firstname}/>

                <label >Surname</label>

                <input type = "text" value = {this.state.surname} onChange = {this.ev_surname}/>

                <label>Date of Birth</label>

                <input type="date" value="2017-06-01" onChange={this.ev_date}/>

                <label >Education</label>

                <input type = "text" value = {this.state.education} onChange = {this.ev_education}/>

                <label >Specialization</label>

                <input type = "text" value = {this.state.specialization} onChange = {this.ev_specialization}/>

                <label >Doctor Code</label>

                <input type = "text" value = {this.state.doccode} onChange = {this.ev_doccode}/>

                <div className = "buttonc">
                <button>register</button>
                </div>
            </form>
        </div>
    );
    }
}

export default RegisterDoctor;
